import React, { Component } from 'react';
import Card from '../card/card';
import M from "materialize-css";
import 'materialize-css/dist/css/materialize.min.css';
import './modelList.css';

class ModelList extends Component {
    componentDidMount() {
        const options = {
            onOpenStart: () => {
                console.log("Open Start");
            },
            onOpenEnd: () => {
                console.log("Open End");
            },
            onCloseStart: () => {
                console.log("Close Start");
            },
            onCloseEnd: () => {
                console.log("Close End");
            },
            inDuration: 250,
            outDuration: 250,
            opacity: 0.5,
            dismissible: false,
            startingTop: "4%",
            endingTop: "10%"
        };
        const elems = document.querySelectorAll('.modal');
        M.Modal.init(elems, options);
    }
    openModelModal(model) {
        let instance = M.Modal.getInstance(document.querySelectorAll('.modal')[0]);
        instance.open();
    }
    render() {
        return (
            this.props.models.length > 0 && this.props.isLoaded
                ? (
                    <div className="gallery">
                        <div className="card-list row">
                            {this.props.models.map(result => (
                                <Card key={result.uid} model={result} showModelDetails={ this.openModelModal }></Card>
                            ))}
                        </div>
                        <div id="modal1" className="modal">
                            AAAAAA
                        </div>
                    </div>
                )
                : !this.props.isLoaded
                    ? (<div className="loading">Loading...</div>)
                    : (<div className="placeholder">The search didn't returned any model.</div>)
        );
    }
}

export default ModelList;
